import React from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content, Grid, Cell} from 'react-mdl';
import Main from './components/main';
import { Link } from 'react-router-dom';
import Resume from './components/resume';
import Projects from './components/projects';

function App() {
  return (
    <div className="demo-big-content">
      <Layout>
        <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/">Crystyano Almeida</Link>} scroll>
          <Navigation>
            <Link to="/resume">Resume</Link>
            <Link to="/aboutme">About Me</Link>
            <Link to="/projects">Projects</Link>
            <Link to="/contact">Contact</Link>
          </Navigation>
        </Header>
        <Drawer title={<Link style={{textDecoration: 'none', color: 'grey'}} to="/">Crystyano Almeida</Link>}>
          <Navigation>
            <Link to="/resume">Resume</Link>
            <Link to="/aboutme">About Me</Link>
            <Link to="/projects">Projects</Link>
            <Link to="/contact">Contact</Link>
          </Navigation>
        </Drawer>
        <Content>
          <Grid>
            <Cell col={12}>
            <Main />
            </Cell>

            <Cell col={12}>
            <Projects />
            </Cell>
          </Grid>
        </Content>
      </Layout>
    </div>
  );
}

export default App;
